# Description:
# ------------
# This file is known as the HyPerf Tool Kit (HTK).  It is the primary
# deliverable of the HyPerf project.
#
# This file is an executable Bash script containing an embedded payload of
# tools, and it functions as its own package management system.  The same
# version of this file can be installed on various systems, regardless of their
# particular package manager.  It can also be readily embedded into RPMs, DPKGs,
# Cygwin packages, or other GNU/Linux-like package management systems.
#
# The HTK is meant to be used by practitioners of HyPerf.
#
# HyPerf stands for (Hy)per (Perf)ormance.  It is a set of information
# techniques, tools, systems, environments, and philosophies that benefit the
# practitioners of the techniques rather than just benefitting the organizations
# that employ them.
#
# This does not mean that the practices of HyPerf and the use of this HTK are
# not beneficial to large organizations though.  Quite the contrary.  HyPerf and
# the HTK are tools that accomplish amazing work in free and open technology
# environments.
#
#
# To understand and begin using the HTK requires that the user have at least a
# top level understanding of what HyPerf is.
#
# The "HyPerf" project derives its name from the concept of Hyper Performance
# Engineering, Administration, and Power Use of computer systems.  This means
# that it offers value to:
#    * Engineers
#    * Administrators
#    * Power Users.
#
# There is an important distinction to make at this point in reading this:
#
# HyPerf is intended not just for one of those skill sets, but for all of them,
# simultaneously.
#
# To accomplish that goal, HyPerf does things differently than most of the
# traditinal Unix/Linux tools of the tech industry.  For some people,
# "different" in this case might mean "better".  For some it might mean worse.
#
# That is for the individual to decide.
#
# One can think of HyPerf sort of like "The Force".  Some of the characters from
# the George Lucas' Star Wars (science fiction) universe have no use for The
# Force.  Others embrace it along with other forms of science, such as
# mechanical and computer technology.  Some think of it as a myth.  Some as
# fact.
#
# The choice to believe in The Force is a personal one.  I suppose the
# characters asks themself, Is Darth Vader actually choking me or am I just
# imagining it?"  Or, "Did I just see Yoda moving that ship, or was it just a
# trick?"
#
# The choice to believe in HyPerf is also a personal one.  One can get real work
# done with the HTK, but it may not be in the way "The Industry" does it.  It
# does not mean the industry is doing it wrong.  It just means there are many
# ways to do things.  There isn't just a single way to get things done.
#
#    --------------------------------------------------------------
#    HyPerf is a different way of doing a number of things in tech.
#    --------------------------------------------------------------
#
# HyPerf emphasises philosophies, techniques, and tools that can be used to
# leverage the powerful capabilities already available in computer ecosystems,
# and in particular Linix-like and Free and Open Source Sofware (FOSS) systems.
# The HTK is the main tool of the project, but it serves many purposes, rather
# than just one.
#
# One must decide for oneself if the work accomplished with the HTK is because
# the philosophies of HyPerf are just a set of tricks and gimmicks, or if they
# are a real and an effectively different way of relating to technology.
#
# HyPerf itself is somewhat like information Kung fu.  Per the original meaning
# of Kung fu, HyPerf requires practice and discipline to be any good at the
# application of its philosophies for IT.  The more one practices, the better
# one can become and the more one can leverage the inherent capabilities of
# FOSS.
#
# The HTK makes such practice more feasible.
#
# The good news is that the HTK is very real.  Whether one believes in the
# philosophy behind the HTK or not, the work one can accomplish with it is very
# real and very effective.
#
# If HyPerf is the philosophies and techniques of hyper performance for
# information management,  then the HTK is somewhat like an exo-skeleton for
# HyPerf practitioners.  The exo-skeleton can magnify the techniques and make
# them faster, better and more powerful.
#
# This kit then is specifically designed to help Engineers, Systems
# Administrators, and Power Users to practice the HyPerf information management
# style, which can be blended with other tools and practices common to
# information technology.
#
#
# Getting Started
# ---------------
# Use the built-in help system to get started quickly...
# ------------------------------------------------------------------------
# To get simple help **BEFORE INSTALLATION**, enter the following command:
# ------------------------------------------------------------------------
#    bash  htk.sh*  --help
#
# --------------------------------------------------------------------------
# To get more detailed help **AFTER INSTALLATION** , enter:
# --------------------------------------------------------------------------
#    htk.sh  --help            (It should now be in your execution path.)
#
# 
# For license information, see the BSD license section at the bottom of this
# file, as well as the documentation in /usr/share/doc/packages/hyperf/ after
# installation.
#
#
# As for the rest of the organization of this kit...
# --------------------------------------------------
# The HTK was designed and edited with special Vim syntax hi-lighting and
# folding features turned on (they are part of the techniques of HyPerf, btw).
# For many users, those features make HyPerf Bash Enterprise Programming quicker
# and easier than the Vim defaults you would find on most systems.
#
# The HTK comes with auto-configuration tools for turning those settings on when
# you want them, but you can also set them manually by creating a shell alias
# such as the following (without the hash symbol [#] in front):
#
# alias pvi.sh="vim -c 'let g:sh_fold_enabled=7' -c ':set fdm=syntax' -c 'sy on'"
#
#
# If you wish to make those settings permanent, append the line just above to
# your ~/.bashrc file, then source the file into your shell (or just close and
# rerun your shell).  If you use the HTK's Portable Linux User Shell (Plush)
# configuration file, which the kit prompts you to install by default, then you
# will already have that alias automatically added to your (Bash) shell's
# startup environment.
#
# If you then edit the HTK like this  "pvi.sh htk.sh"  vim will automatically
# show syntax hi-lighting for you.  It will also automatically fold functions
# and control structures in the code for you.
# 
#
# If you are looking through the code, it is organized into the following
# sections, which can be quickly and easily jumped to in Vim.  In fact, scripts
# in the HTK which follow the HyPerf coding style generally use this format for
# their layout.  This is the general HyPerf coding style layout:
#       ┌────────────────────────────────────────────────┐
#       │┌──────────────────────────────────────────────┐│
#       ││┌────────────────────┐                        ││
#       │││Headers (at the top)│                        ││
#       ││└────────────────────┘                        ││
#       ││┌────────────────────────────────────────────┐││
#       │││Description (which you're reading right now)│││
#       ││└────────────────────────────────────────────┘││
#       │└──────────────────────────────────────────────┘│
#       │(Sourcing of libraries)                         │
#       │┌──────────────────────────────┐                │
#       ││A Variable Quick Reference Key│                │
#       │└┬───────────────────────────┬─┘                │
#       │ │Global Variable Definitions│                  │
#       │ └───────────────────────────┘                  │
#       │┌─────────────────────┐                         │
#       ││Functions Definitions│                         │
#       │└─────────────────────┘                         │
#       │   ..................                           │
#       │   .┌──────────────┐.                           │
#       │   .│Main Code Body│.                           │
#       │   .└──────────────┘.                           │
#       │   ..................                           │
#       │┌─────────┐                                     │
#       ││Changelog│                                     │
#       │└─────────┘                                     │
#       │                                                │
#       │┌─────────────────────────────────────────┐     │
#       ││                          ┌─┐┌─┐┌─┐┌─┐┌─┐│     │
#       ││Embedded Payload of Tools:│ ││ ││ ││ ││ ││     │
#       ││                          └─┘└─┘└─┘└─┘└─┘│     │
#       │└─────────────────────────────────────────┘     │
#       │                                                │
#       │┌───────────────────────┐                       │
#       ││License (at the bottom)│                       │
#       │└───────────────────────┘                       │
#       └────────────────────────────────────────────────┘
#
# The follow paragraphs explain some of the structure shown above, but it is
# also helpful to know that the HTK
# comes with a built-in help system (as mentioned, above) with lots of
# documentation, and there are also guides and READMEs embedded in its payload.
#
#
# Code layout: Headers, Description, Libraries ... down through Main code body
# ----------------------------------------------------------------------------
# The HTK code (variables definitions, function definitions, and main code body)
# are all written in Bash.  There is a good reason for this which stems from the
# HyPerf KISS philosophy, which is Keep It *SUFFICIENTLY* Simple.  But there is
# no reason why the principles of HyPerf could not apply (and thus be ported) to
# another shell such as Zsh, or to a more powerful intepreted programming
# language such as Python or Perl.  Bash may not be perfect, but
# it was chosen because it meets the following criteria:
#    * It has VERY rich interactive shell mode
#    * It is powerful enough to get the job done
#    * It is ubiquitous enough to get the job done
#
# By those standards, using bash satisfies the KISS principle of HyPerf:
#       "Keep It **Sufficiently** Simply
#
#
# Code layout: The Changelog
# --------------------------
# I think the changelog section is self-explanatory.
#
#
# Code Layout: The Embedded Payload
# ---------------------------------
# The embedded payload is just a base64 encoded tarball of various Bash scripts
# that can be used either as standalone tools, or as integral parts of the
# larger HyPerf framework, or even other frameworks for that matter.
#
# The HTK helps you set up and tear down such frameworks quickly and easily.  It
# can be used as an add-on for other DevOps environments, it can be used on its
# own to do mass management of systems, or it can be used on a single machine
# for its various Power User features.
#
# The HTK can be installed permanently, if desired, or it can just be used
# quickly and then removed.
#
# It has been used both ways successfully for many years.
#
# The toolkit has features to help you easily browse and extract its individual
# components or extract the entire payload.  You don't even have to perform an
# installation to pull out components you want to use.
#
#
# Code Layout: License
# --------------------
# This section is also self-explanatory.
#
#
# The Two Main Purposes of the HTK
# --------------------------------
# You can read more about this in the built-in help system, but the two main
# purposes of the HTK are:
#    1. Act as a self-managing software package to use on multiple version of
#       Linux, etc.
#    2. Act as a multiplexor mass-management engine for performing DevOps
#       related tasks.
#
# You can read more about the features 
#
# Since the code is written in Bash, the source code is essentially the same as
# the "compiled" code.  The HTK is actually just the source code for the project
# "compiled" into a single executable script.  The HTK thus has a feature for
# rebuilding the source code development structure, right from the HTK itself.
# By design, the HTK can easily be customized per an individual's or
# organization's specific needs.  You may want to check it out some time to
# customize the HTK for your own needs.
#
# You can read more about all of that in the built-in help.
#
# Of course, you can manually browse through the code to your heart's content,
# but I do suggest using the built-in help system to get started, as mentioned
# above.  The built-in help system contains good ideas to get you using the HTK
# as quickly and effectively as possibleC.
#
# 
# Have fun.
#
# -bkh
